const  initialState = { 
    DataLoading: {
        isLeftDataLoaded: 0, 
        isRightDataLoaded: 0, 
    },
    SetUser: {
        user: 'none'
    },
    ShowOnRight: {
        rightShowWelcome: 1, 
        rightShowSearchAndResults: 0, 
        rightShowVideo: 0
    },
    ModalReducer: {
        dimmer: 'blurring',
        isModalOpen: false,
        video: {
            thumbnails: {
                medium: {
                    url: 'https://image.noelshack.com/fichiers/2020/12/4/1584640362-loading-medium.gif', 
                    width: 320, 
                    height: 180
                },
                high: {
                    url: 'https://image.noelshack.com/fichiers/2020/12/4/1584640514-loading-high.gif',
                    width: 480,
                    height: 360,
                }
            },
          title: 'Mimie <3',
          id: '151561'
        }
    } 
};

export default initialState;
